import React, { Component } from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"
import "slick-carousel/slick/slick.theme.css"

function ImageSlider(){
    let settings = {
        dot:true,
        infinite: true,
        speed: 500,
        slidesToshow: 3,
        slidesToScroll: 1,
        cssEase: "linear"
    }
    return(
        <Slider {...settings}>

        </Slider>
    )
}

export default ImageSlider;
